n  // Push a character or its entity onto the current line\n  push = function () {\n    if (ch < ' ' || ch > '~') {\n      line.push('&#' + ch.charCodeAt(0) + ';');\n    } else {\n      line.push(ch);\n    }\n  };\n\n  // Use only integer part of tabs, and default to 4\n  tabs = (tabs >= 0) ? Math.floor(tabs) : 4;\n\n  result = [];\n  line = [];\n\n  i = 0;\n  next();\n  while (i <= source.length) { // less than or equal, because i is always one ahead\n    ch = peek;\n    next();\n\n    // HTML special chars.\n    switch (ch) {\n      case '<':\n        line.push('&lt;');\n        break;\n      case '>':\n        line.push('&gt;');\n        break;\n      case '&':\n        line.push('&amp;');\n        break;\n      case '\"':\n        line.push('&quot;');\n        break;\n      case \"'\":\n        line.push('&#39;');\n        break;\n      default:\n        // If the output is intended for display,\n        // then end lines on newlines, and replace tabs with spaces.\n        if (display) {\n          switch (ch) {\n            case '\\r':\n              // If this \\r is the beginning of a \\r\\n, skip over the \\n part.\n              if (peek === '\\n') {\n                next();\n              }\n              endline();\n              break;\n            case '\\n':\n              endline();\n              break;\n            case '\\t':\n              // expand tabs\n              spaces = tabs - (line.length % tabs);\n              for (s = 0; s < spaces; s += 1) {\n                line.push(' ');\n              }\n              break;\n            default:\n              // All other characters can be dealt with generically.\n              push();\n          }\n        } else {\n          // If the output is not for display,\n          // then none of the characters need special treatment.\n          push();\n        }\n    }\n  }\n  endline();\n\n  // If you can't beat 'em, join 'em.\n  result = result.join('<br />');\n\n  if (display) {\n    // Break up contiguous blocks of spaces with non-breaking spaces\n    result = result.replace(/ {2}/g, ' &nbsp;');\n  }\n\n  // tada!\n  return result;\n}\n\n\nCP_Model2WebClient_Default.prototype.clearForm=function(actObj) {\n\n  var ent = actObj.entDef;\n  var entName = ent.name;\n  var actName = actObj.name;\n  var actFolder = actObj.getFolderName();\n  var actSysName = actFolder+'_'+actName;\n  var code = '';\n  for(var i=0;i<actObj.field.length;i++) {\n    var prop = ent.getPropByName(actObj.field[i]);\n    var refe = ent.getRefeByName(actObj.field[i]);\n    var fgrefe = ent.getFgRefeByName(actObj.field[i]);\n    if(prop) {\n      var typeVal = prop.type;\n      var name = prop.name;\n      if(typeVal == 'Boolean') {\n        code += '$(\"#Form_'+actSysName+' #'+name+'\").attr(\"checked\", false);\\n';\n      } else if(typeVal == 'String' && prop.getPassword()) {\n        code += '$(\"#Form_'+actSysName+' #'+name+'\").val(\"\");\\n';\n        code += '$(\"#Form_'+actSysName+' #'+name+'_Repeat\").val(\"\");\\n';\n      } else {\n        code += '$(\"#Form_'+actSysName+' #'+name+'\").val(\"\");\\n';\n      }\n    } else if(refe) {\n      var name = refe.name;\n      var editor = this.getRefeEditorType(actObj, ent, refe.name);\n      if(editor===\"Select\") {\n        code += '$(\"#Form_'+actSysName+' #'+name+'\").empty();\\n';\n      } else {\n        code += '$(\"#Form_'+actSysName+' #'+name+'\").val(\"\");\\n';\n        code += '$(\"#Form_'+actSysName+' #'+name+'_Editor\").empty();\\n';\n      }\n    } else if(fgrefe) {\n      var name = fgrefe.name;\n      code += '$(\"#Form_'+actSysName+' #'+name+'\").val(\"\");\\n';\n      code += '$(\"#Form_'+actSysName+' #'+name+'_Editor\").empty();\\n';\n    }\n  }\n  return code;\n\n}\n\nCP_Model2WebClient_Default.prototype.obj2Form=function(actObj, editable) {\n\n  var ent = actObj.entDef;\n  var entName = ent.name;\n  var actName = actObj.name;\n  var actFolder = actObj.getFolderName();\n  var actSysName = actFolder+'_'+actName;\n 